import React from "react"
import * as jsPDF from 'jspdf'

import Layout from "../components/layout"
import SEO from "../components/seo"

const imgData = 'data:image/jpeg;base64,'

var doc = new jsPDF({
  orientation: 'landscape',
  unit: 'cm',
  format: 'a4'
})

doc.setFont('helvetica')

doc.setFontSize(48)

doc.addImage(imgData, 'JPEG', 0, 0, 29.7, 21)

doc.setTextColor(47, 84, 150)

let widthPhrase = doc.getStringUnitWidth('CERTIFICADO')
let dist = (29.7 - ((widthPhrase*48)/(72/25.6))/10)/2
doc.text(dist, 6, 'CERTIFICADO')

doc.setFontSize(18)

doc.setTextColor(0, 0, 0)

widthPhrase = doc.getStringUnitWidth('Certificamos que')
dist = (29.7 - ((widthPhrase*18)/(72/25.6))/10)/2
doc.text(dist, 8.5, 'Certificamos que')

doc.setFontSize(24)

doc.setTextColor(47, 84, 150)

const name = decodeURI(window.location.search.split('?=')[(window.location.search.split('?=').length - 1)])

widthPhrase = doc.getStringUnitWidth(name)
dist = (29.7 - ((widthPhrase*24)/(72/25.6))/10)/2
doc.text(dist, 9.5, name)

doc.setFontSize(18)

doc.setTextColor(0, 0, 0)

widthPhrase = doc.getStringUnitWidth('participou da 3ª React Conference Brasil.')
dist = (29.7 - ((widthPhrase*18)/(72/25.6))/10)/2
doc.text(dist, 10.5, 'participou da 3ª React Conference Brasil.')

widthPhrase = doc.getStringUnitWidth('Realizada em 19 de outubro de 2019, com duração de 10 horas e meia.')
dist = (29.7 - ((widthPhrase*18)/(72/25.6))/10)/2
doc.text(dist, 11.5, 'Realizada em 19 de outubro de 2019, com duração de 10 horas e meia.')



const ass = 'data:image/png;base64,'

doc.addImage(ass, 'PNG', 11.5, 15.3, 6.69, 2.43)

doc.setFontSize(12)

widthPhrase = doc.getStringUnitWidth('_________________________________________')
dist = (29.7 - ((widthPhrase*12)/(72/25.6))/10)/2
doc.text(dist, 17, '_________________________________________')

widthPhrase = doc.getStringUnitWidth('Átomos Nativos, Grafos e Retransmissões')
dist = (29.7 - ((widthPhrase*12)/(72/25.6))/10)/2
doc.text(dist, 17.7, 'Átomos Nativos, Grafos e Retransmissões')

widthPhrase = doc.getStringUnitWidth('Diretora: Caroline Marcondes')
dist = (29.7 - ((widthPhrase*12)/(72/25.6))/10)/2
doc.text(dist, 18.4, 'Diretora: Caroline Marcondes')


const IndexPage = () => (
  <Layout>
    <SEO title="Home" />
    <button type="button" onClick={() => doc.save("certificado.pdf")}>Download</button>
  </Layout>
)

export default IndexPage
